import React from "react";
import { useNavigate } from "react-router-dom";
import { useTranslation } from "react-i18next";

const LandingPage = () => {
  const navigate = useNavigate();
  const { t, i18n } = useTranslation();

  const features = [
    { title: t("feature1_title"), description: t("feature1_desc"), emoji: "üìÑ" },
    { title: t("feature2_title"), description: t("feature2_desc"), emoji: "üìä" },
    { title: t("feature3_title"), description: t("feature3_desc"), emoji: "üîí" },
    { title: t("feature4_title"), description: t("feature4_desc"), emoji: "üì±" },
    { title: t("feature5_title"), description: t("feature5_desc"), emoji: "üá∞üá™" },
    { title: t("feature6_title"), description: t("feature6_desc"), emoji: "üéÅ" },
  ];

  const toggleLanguage = () => {
    const newLang = i18n.language === "en" ? "sw" : "en";
    i18n.changeLanguage(newLang);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-900 via-purple-800 to-blue-700 text-white font-sans overflow-x-hidden">
      {/* Header */}
      <div className="flex justify-between items-center px-6 py-4 bg-indigo-900 shadow-md">
        <h1 className="text-2xl font-bold tracking-wide">
          üßæ Taxika <span className="text-sm font-light">| üá∞üá™ Kenya's Smart Tax Assistant</span>
        </h1>
        <div className="flex items-center gap-4">
          <button onClick={toggleLanguage} className="bg-blue-500 px-3 py-1 rounded-full text-sm hover:bg-blue-600 transition">
            üåê {i18n.language === "en" ? "Kiswahili" : "English"}
          </button>
          <button onClick={() => navigate("/login")} className="hover:underline text-white">üîê {t("login")}</button>
          <button onClick={() => navigate("/register")} className="hover:underline text-white">üìù {t("register")}</button>
        </div>
      </div>

      {/* Hero Section */}
      <div className="text-center py-20 px-4">
        <h2 className="text-4xl sm:text-5xl font-bold mb-4">
          üåç {t("title")}
        </h2>
        <p className="text-lg mb-8 max-w-2xl mx-auto">
          üí° {t("description")}
        </p>
        <div className="flex justify-center gap-4">
          <button
            onClick={() => navigate("/login")}
            className="bg-blue-600 hover:bg-blue-700 px-6 py-3 rounded-full font-semibold shadow transition text-white"
          >
            üöÄ {t("getStarted")}
          </button>
          <button
            onClick={() => navigate("/register")}
            className="bg-white text-indigo-800 hover:bg-gray-200 px-6 py-3 rounded-full font-semibold shadow transition"
          >
            üÜï {t("createAccount")}
          </button>
        </div>
      </div>

      {/* Feature Section */}
      <div className="bg-white text-gray-800 py-16 px-4">
        <h3 className="text-center text-3xl font-extrabold mb-12">
          ‚ú® {t("featuresTitle")}
        </h3>
        <div className="grid sm:grid-cols-2 md:grid-cols-3 gap-10 max-w-6xl mx-auto">
          {features.map((feature, index) => (
            <div key={index} className="text-center p-6 border rounded-xl hover:shadow-lg transition">
              <div className="text-5xl mb-3">{feature.emoji}</div>
              <h4 className="text-xl font-bold mb-2">{feature.title}</h4>
              <p className="text-sm text-gray-600">{feature.description}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Footer */}
      <footer className="text-center py-6 text-sm bg-indigo-900 text-white">
        ¬© {new Date().getFullYear()} Taxika. Made with ‚ù§Ô∏è in Kenya.
      </footer>
    </div>
  );
};

export default LandingPage;
